import React from "react";

const Navbar = () => {
  return (
    <nav className='navbar bg-dark'>
      <h4>
        <a href='index.html'>GUARDIAN</a>
      </h4>
      <ul>
        <li>
          <a href='profiles.html'>Volunteers</a>
        </li>
        <li>
          <a href='register.html'>Register</a>
        </li>
        <li>
          <a href='login.html'>Login</a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
